Styles.Screen:
:root {
    --text-height: 4vmin;
    --background-color: bisque;
    --background-color-control: thistle;
    --background-color-focus: burlywood;
    --background-color-active: beige;
    --menu-width: 20ch;
    --main-height: 85vmin;
    --control-height: 5vmin;
    --control-border-radius: 2vmin;
    --opacity-screen: 0.5
}

* {
    margin: 0;
    padding: 0;
}

body {
    font-family: Arial;
    font-size: 2.5vmin;
    font-weight: bold;
    color: blue;
    background-color: grey;
    padding: 0 1vmin;
    overflow: auto;
}

.box {
    z-index: 1;
    border: 0.2vmin solid black;
    background-color: var(--background-color);
    border-radius: 2vmin;
    margin-top: 0.5vmin;
    box-shadow: 0 0 1vmin 0 rgba(0, 0, 0, 0.2),
        0 1vmin 1vmin 0 rgba(0, 0, 0, 0.24);
}
.header {
    display: grid;
    grid-template-columns: 20vmin auto 20vmin;
    grid-template-rows: var(--text-height);
    line-height: var(--text-height);
    text-align: center;
    text-transform: uppercase;
}

.main {
    height: var(--main-height);
    overflow: auto;
    opacity: var(--opacity-screen);
}

.footer {
    height: var(--text-height);
    line-height: var(--text-height);
    text-align: center;
    vertical-align: middle;
    text-transform: uppercase;
}

.errorMessage {
    color: red;
}

Styles.Dialog:
.dialog {
    text-align: center;
    margin: auto;
    padding: 1vmin;
    background-color: var(--background-color-control);
}

.dialog>img {
    width: 10vmin;
}

.dialog>p {
    margin: 2ch 5ch;
    word-wrap: break-word;
}

.dialog button {
    text-transform: uppercase;
    outline: 0;
    background: var(--background-color-control);
    width: 15vmin;
    height: var(--control-height);
    border: 0;
    font-size: inherit;
    padding: 1vmin;
    background-color: var(--background-color);
    font-weight: inherit;
    cursor: pointer;
    border-radius: 2vmin;
    margin-top: 3vmin;
    margin-right: 2vmin;
}

Styles.Login:
.login {
    max-width: 30vmin;
    margin: 10vmin auto 0 auto;
    background-color: var(--background-color);
    width: 50vmin;
    height: var(--control-height * 3);
    padding: 5vmin;
    text-align: center;
}

.login input {
    outline: 0;
    background: white;
    width: 30vmin;
    height: var(--control-height);
    border: 0;
    margin: 0 0 1vmin 0;
    color: black;
    font-size: inherit;
    padding: 1vmin;
    box-sizing: border-box;
    border-radius: 2vmin;
    border: 0.2vmin solid black;
}

.login button {
    text-transform: uppercase;
    outline: 0;
    background: var(--background-color-control);
    width: 15vmin;
    height: var(--control-height);
    border: 0;
    font-size: inherit;
    padding: 1vmin;
    color: inherit;
    font-weight: inherit;
    cursor: pointer;
    border-radius: 2vmin;
    margin-top: 3vmin;
}

.login button:hover,
.login button:focus {
    background: var(--background-color-focus);
}

.login button:active {
    background-color: var(--background-color-active);
}

Styles.Menu:
.menu {
    border-radius: var(--control-border-radius);
    background-color: var(--background-color);
    height: var(--control-height);
    margin-top: 1vmin;
    padding: 1vmin 0;
    border: 0.2vmin solid black;
    box-shadow: 0 0 1vmin 0 rgba(0, 0, 0, 0.2), 0 1vmin 1vmin 0 rgba(0, 0, 0, 0.24);
}

.menu ul li {
    display: inline;
    background-color: var(--background-color-control);
    float: left;
    width: var(--menu-width);
    height: var(--control-height);
    line-height: var(--control-height);
    text-align: center;
    position: relative;
    cursor: pointer;
}

.menu>ul>li {
    border-radius: var(--control-border-radius);
    border-top-left-radius: var(--control-border-radius);
    margin-left: 0.5ch;
    margin-right: 0.5ch;
}

.menu ul {
    padding: 0px;
}

.menu ul ul {
    display: none;
}

.menu ul li:hover>ul {
    display: block;
}

.menu ul ul ul {
    margin-left: calc(var(--menu-width) + 0.1ch);
    top: 0;
    position: absolute;
}

.menu ul li:hover,
.menu ul ul li:hover,
.menu ul ul ul li:hover {
    background-color: var(--background-color-focus);
}

.menu ul li:active,
.menu ul ul li:active,
.menu ul ul ul li:active {
    background-color: var(--background-color-active);
}

.parentMenu {
    float: right;
    font-size: 2vmin;
}

.firstItem {
    border-top-left-radius: var(--control-border-radius);
    border-top-right-radius: var(--control-border-radius);
}

.lastItem {
    border-bottom-left-radius: var(--control-border-radius);
    border-bottom-right-radius: var(--control-border-radius);
}

Styles.Grid:
.grid {
    width: 100%;
    height: 99%;
    border-collapse: collapse;
    text-align: center;
    font-size: 2vmin;
    color: black;
    border: solid 0.1vmin black;
    font-weight: normal;
    white-space: nowrap;
    max-width: 100%;
}

.grid tbody tr:nth-of-type(odd) {
    background-color: var(--background-color-active);
}

.currentRow {
    background-color: var(--background-color-control);
}

.grid td,
.grid th {
    padding: 1vmin;
    border-right: solid 0.1vmin black;
}

.grid th {
    border-top: solid 1px black;
    text-align: center;
}

.grid td.real {
    text-align: right;
}

.grid td.real::before {
    content: 'R$ ';
}

.grid thead tr,
.grid tfoot tr {
    background-color: var(--background-color-focus);
    position: sticky;
    height: 1.5vmin;
}

.grid thead tr {
    top: 0;
}

.grid tfoot tr {
    bottom: 0;
}

.grid tbody tr:nth-of-type(n):hover {
    background-color: var(--background-color-focus);
}

.grid input[type=number]::-webkit-inner-spin-button,
.grid input[type=number]::-webkit-outer-spin-button {
    opacity: 1;
}

.grid th button {
    text-transform: uppercase;
    outline: 0;
    background-color: var(--background-color-focus);
    width: var(--control-height);
    height: var(--control-height);
    border: 0;
    font-size: inherit;
    color: inherit;
    font-weight: inherit;
    cursor: pointer;
    border-radius: 2.5vmin;
    background-size: 100% 100%;
    margin: 0.5vmin 3vmin;
}

.grid th button:hover {
    background: var(--background-color-control);
    background-size: 100% 100%;
}

.div .button:active {
    background: var(--background-color-active);
}

.grid th button:active {
    background-color: var(--background-color-active);
    background-size: 100% 100%;
}

.numberPage {
    text-align: right;
    width: 10vmin;
    height: 3vmin;
    font-size: inherit;
    float: left;
}

.rangePage {
    width: 50vmin;
    height: 3vmin;
    font-size: inherit;
    float: left;
}

Styles.Form:
.form {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
}

.form fieldset {
    border: none;
    color: black;
    font-size: 2vmin;
    margin: 2vmin;
    text-align: center;
}

.form input {
    height: 2.5vmin;
}

.buttonsBar {
    text-align: center;
}

.buttonsBar .button {
    margin-top: 1vmin;
    margin-bottom: 1vmin;
    margin-right: 5vmin;
    width: 20vmin;
    height: 3.5vmin;
    font-size: 2vmin;
    background: var(--background-color-control);
    background-position: left;
    background-repeat: no-repeat;
    background-size: 15%;
}

.buttonsBar .button:hover {
    background: var(--background-color-focus);
    background-repeat: no-repeat;
    background-size: 15%;
}

.buttonsBar .button:active {
    background: var(--background-color-active);
    background-repeat: no-repeat;
    background-size: 15%;
}
